import Container from 'react-bootstrap'; 
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
function Bootstrap()  {
    return(
            <Container>
              <Row>
                <Col>1 of 3</Col>
                <Col xs={6}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
              </Row>
              <Row>
                <Col>1 of 3</Col>
                <Col xs={5}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
              </Row>
            </Container>
          );
        }
           
   
export default Bootstrap;
